import React, { Fragment } from "react";
import { useAlert } from "react-alert";

const Alert = () => {
  const alert = useAlert();

  return (
    <Fragment>
      <button
        onClick={() => {
          alert.show("Done!");
        }}
      >
        Show Alert
      </button>
      <button
        onClick={() => {
          alert.error("You just broke something!");
        }}
      >
        Oops, an error
      </button>
      <button
        onClick={() => {
          alert.success("Item Added Successfully!");
        }}
      >
        Success!
      </button>
    </Fragment>
  );
};

export default Alert;
